import React, { Component } from 'react';

const Columns = (props) => {
	const column = props.display_type == '2 column' ? 2 : 3;

	const container = {
		width: '100%',
		display: 'grid',
		gridTemplateColumns: `reapeat(${column}, 1fr)`,
		gridTemplateRows: 'auto',
	};

	return <div style={container}>columns</div>;
};

export default Columns;
